function PolygonPlot(map,polyton_array,strokecolor,strokeWeight,fillcolor,fillOpacity){
    var polygon = new qq.maps.Polygon({
        path:polyton_array,
        strokeColor: strokecolor,
        strokeWeight: strokeWeight,
        fillColor: qq.maps.Color.fromHex(fillcolor, fillOpacity),
        map: map
    });
}

function Polygon(map,polygon_str,stroke_score=0.0,strokeWeight,fillOpacity,fill_score){
    fillcolor = getColr(fill_score);
    strokecolor = getColr(stroke_score);
    point_arr = polygon_str.split(';');
    var polygonArr = new Array();//多边形覆盖物节点坐标数组
    for(var i=0; i<point_arr.length; i++){
        point = point_arr[i].split(',');
        lat = parseFloat(point[1]);
        lng = parseFloat(point[0]);
        var point = new qq.maps.LatLng(lat,lng);
        polygonArr.push(point);
    }
    plot = new PolygonPlot(map,polygonArr,strokecolor,strokeWeight,fillcolor,fillOpacity);
}

function Polygon2center(polygon){
    point_arr = polygon.split(';');
    var lng = new Array();
    var lat = new Array();
    for(var i=0; i<point_arr.length; i++){
        point = point_arr[i].split(',');
        lng.push(parseFloat(point[0])); 
        lat.push(parseFloat(point[1])); 
    }
    var lng_cen = ( Math.max.apply(null, lng) + Math.min.apply(null, lng) ) / 2;
    var lat_cen = ( Math.max.apply(null, lat) + Math.min.apply(null, lat) ) / 2;
    //console.log(lng_cen); console.log(lat_cen);
    return lng_cen + ',' + lat_cen;
}

function GeoHash(map,geohash,score){
    this.box = decodeGeoHash(geohash);
    console.log(this.box);
    color = getColr(score);
    var topleft = new qq.maps.LatLng(this.box.latitude[1]*1.0, this.box.longitude[0]*1.0);
    var topright = new qq.maps.LatLng(this.box.latitude[1]*1.0, this.box.longitude[1]*1.0);
    var buttomright = new qq.maps.LatLng(this.box.latitude[0]*1.0, this.box.longitude[1]*1.0);
    var buttomleft = new qq.maps.LatLng(this.box.latitude[0]*1.0, this.box.longitude[0]*1.0);
    var polygonArr = new Array();//多边形覆盖物节点坐标数组
    polygonArr.push(topleft);
    polygonArr.push(topright);
    polygonArr.push(buttomright);
    polygonArr.push(buttomleft);
    plot = new PolygonPlot(map,polygonArr,color,0,color,0.6);
}

function Discrete(score){

function isInArray(arr,value){

        }
